const RestaurantListItem = ({ name, rating, cuisines, reviews, address }) => {
  return (
    <li>
      <h3>{name}</h3>
      <h6>{address}</h6>
      <p>
        Rating: {rating} ({reviews} reviews)
      </p>
      <ul>
        {cuisines.data.map((cuisine, index) => (
          <li key={index}>{cuisine}</li>
        ))}
      </ul>
    </li>
  );
};

export default RestaurantListItem;
